import React from 'react';

const Wishlist = ({ wishlist }) => {
  return (
    <div className="wishlist">
      <h2>Список желаемого</h2>
      <ul>
        {wishlist.length === 0 ? (
          <li>Список желаемого пуст</li>
        ) : (
          wishlist.map(item => (
            <li key={item.id}>{item.name}</li>
          ))
        )}
      </ul>
    </div>
  );
};

export default Wishlist;
